import React from 'react'

export default function ApptDialog() {
  return (
    <div>
              <Dialog open={dialogOpen} onClose={handleCloseDialog}>
                <DialogTitle>Selected Date: {selectedDate}</DialogTitle>
                <DialogContent>
                    <Typography variant="body2">Available Start Times:</Typography>
                    {selectedStartTimes.map((startTime, index) => (
                        <Chip
                            key={index}
                            label={startTime}
                            variant="outlined"
                            color="primary"
                            className="mt-2"
                            onClick={() => setSelectedStartTime(startTime)}
                        />
                    ))}
                    {selectedStartTime && (
                        <Button
                            variant="contained"
                            color="primary"
                            onClick={() => handleBooking(selectedStartTime)}
                        >
                            Book Appointment
                        </Button>
                    )}
                </DialogContent>
            </Dialog>
    </div>
  )
}
